webpackJsonp([0x7364af4bad94],{8517:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Carrie Tollefson, Up Close and Personal",date:"24 Aug 2004",slug:"/2004-08-24-up-close-and-personal/",tags:"Y2004"},html:'<p>I haven\'t been paying real close attention to the Olympics, but I did make sure to watch the women\'s 1500 m heat this evening to see if <a href="http://www.nbcolympics.com/athletebios/5030697/detail.html" title="NBCOlympics.com - Athlete Bios - Carrie Tollefson">Carrie Tollefson</a> would qualify for the next round. Carrie is from my hometown... welll, not exactly, she\'s actually from the town next to my hometown. And, I don\'t exactly know her (she was 3 years old when graduated from high school), but it\'s a small county where everyone knows everyone else, so I must know her cousin or something. (And like my wife said, Tollefson is a good, solid Minnesota last name.) And, yes, <a href="http://www.nbcolympics.com/results/5001368/detail.html">she did make the semi-finals</a>, so she runs again in Athens on Thursday. Go, Carrie, go!</p>'},next:{fields:{title:"",date:"24 Aug 2004",slug:"/2004-08-24-schroeder-egged/"}},previous:{fields:{title:"Case Modding",date:"26 Aug 2004",slug:"/2004-08-26-case-modding/"}}},{node:{fields:{title:"",date:"24 Aug 2004",slug:"/2004-08-24-schroeder-egged/",tags:"Y2004"},html:'<p><a href="http://www.spiegel.de/politik/deutschland/0,1518,314737,00.html" title="Brandenburg: Demonstranten bewerfen Schröder mit Eiern - Politik - SPIEGEL ONLINE">Demonstrators throw eggs at Chancellor Schröder in Brandenburg</a>, although unlike with <a href="http://www.faz.net/s/Rub21DD40806F8345FAA42A456821D3EDFF/Doc~E96DFB100BE6D4DBFB4133EBB338325F7~ATpl~Ecommon~Scontent.html">Helmut Kohl in Halle in 1991</a>, they missed.</p>'},next:{fields:{title:"Happy Birthday To Me",date:"24 Aug 2004",slug:"/2004-08-24-happy-birthday-to-me/"}},previous:{fields:{title:"Carrie Tollefson, Up Close and Personal",date:"24 Aug 2004",slug:"/2004-08-24-up-close-and-personal/"}}},{node:{fields:{title:"Happy Birthday To Me",date:"24 Aug 2004",slug:"/2004-08-24-happy-birthday-to-me/",tags:"Y2004"},html:'<p><a href="http://www.hebig.com/archives/002433.shtml">Heiko notes</a> that <a href="http://www.evhead.com/2004/08/five-years-ago-today-we-just-launched.asp">PyraLabs launched Blogger five years ago</a>. Which means that <a href="http://www.papascott.de/blogger99.html">I\'ve been weblogging for five years</a>. I just didn\'t know what I was doing back then. (I\'m guessing I saw it <a href="http://archive.scripting.com/1999/08/23">here</a>.)</p>'},next:{fields:{title:"Perspective",date:"23 Aug 2004",slug:"/2004-08-23-perspective/"}},previous:{fields:{title:"",date:"24 Aug 2004",slug:"/2004-08-24-schroeder-egged/"}}}],pathPrefix:"",first:!1,last:!1,index:429,pageCount:1101}}}});
